--
-- Disparadores `ficha_matricula`
--
DROP TRIGGER IF EXISTS `actualizar_aforo`;
DELIMITER $$
CREATE TRIGGER `actualizar_aforo` AFTER INSERT ON `ficha_matricula` FOR EACH ROW BEGIN
    DECLARE seccion_a_actualizar INT;

    -- Obtener el id_Seccion registrado en la nueva ficha_matricula
    SELECT id_Seccion INTO seccion_a_actualizar FROM ficha_matricula WHERE id_Ficha_matricula = NEW.id_Ficha_matricula;

    -- Disminuir el aforo en la tabla seccion
    UPDATE seccion SET aforo = aforo - 1 WHERE id_Seccion = seccion_a_actualizar;
END
$$
DELIMITER ;

