DROP TRIGGER IF EXISTS `perfil_insert_trigger`;
DELIMITER $$
CREATE TRIGGER `perfil_insert_trigger` AFTER INSERT ON `perfil` FOR EACH ROW BEGIN
    INSERT INTO perfil_registro (
        id_Perfil,
        id_RolInicial,
        nombre_PerfilInicial,
        descripcionInicial,
        id_RolActualizada,
        nombre_PerfilActualizada,
        descripcionActualizada
    )
    VALUES (
        NEW.id_Perfil,
        NEW.id_Rol,
        NEW.nombre_Perfil,
        NEW.descripcion,
        NEW.id_Rol,
        NEW.nombre_Perfil,
        NEW.descripcion
    );
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `perfil_update_trigger`;
DELIMITER $$
CREATE TRIGGER `perfil_update_trigger` AFTER UPDATE ON `perfil` FOR EACH ROW BEGIN
    UPDATE perfil_registro
    SET
        id_RolInicial = OLD.id_Rol,
        nombre_PerfilInicial = OLD.nombre_Perfil,
        descripcionInicial = OLD.descripcion,
        id_RolActualizada = NEW.id_Rol,
        nombre_PerfilActualizada = NEW.nombre_Perfil,
        descripcionActualizada = NEW.descripcion
    WHERE
        id_Perfil = NEW.id_Perfil;
END
$$
DELIMITER ;

